import org.apache.jena.query.Query;
import org.apache.jena.query.QueryExecution;
import org.apache.jena.query.QueryExecutionFactory;
import org.apache.jena.query.QueryFactory;
import org.apache.jena.query.QuerySolution;
import org.apache.jena.query.ResultSet;
import org.apache.jena.rdf.model.Model;
import org.apache.jena.rdf.model.ModelFactory;
import org.apache.jena.util.FileManager;

public class SPARQLExample {
    public static void main(String[] args) {
        // Load the data from the container.ttl file
        Model model = ModelFactory.createDefaultModel();
        FileManager.get().readModel(model, "container.ttl");

        // Define the SPARQL query
        String queryString = "PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>\n"
                + "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>\n"
                + "PREFIX owl: <http://www.w3.org/2002/07/owl#>\n"
                + "\n"
                + "SELECT DISTINCT ?property\n"
                + "WHERE {\n"
                + "    ?property rdfs:domain ?class .\n"
                + "    ?class rdfs:label \"Pool Certificate\"@en .\n"
                + "}";
        Query query = QueryFactory.create(queryString);

        // Execute the query and print the results
        QueryExecution qexec = QueryExecutionFactory.create(query, model);
        ResultSet results = qexec.execSelect();
        while (results.hasNext()) {
            QuerySolution soln = results.nextSolution();
            System.out.println(soln.getResource("property"));
        }
        qexec.close();
    }
}
```

Note that this code assumes that the `container.ttl` file is in the same directory as the Java code. If the file is located elsewhere, you'll need to provide the correct path to `FileManager.get().readModel()`.
